// https://www.ihe.net/uploadedFiles/Documents/ITI/IHE_ITI_Suppl_On_Demand_Documents_Rev1.3_TI_2013-10-25.pdf
// Type this URN urn:uuid:7edca82f-054d-47f2-a032-9b2a5b5186c1 and search
// This depends on weather your customers need on-demand document response or stable document response.
